const calendlyWidgetButton=document.querySelector(".button.cta-white.w-button");async function openCalendlyWidget(e){Calendly.initPopupWidget({url:"https://calendly.com/twenty-five/30min",text:"Schedule time with me",color:"#0069ff",textColor:"#ffffff",branding:!0})}function checkCalendlyEventScheduled(e){if(isCalendlyEvent(e)&&"calendly.event_scheduled"==e.data.event){document.querySelector(".calendly-popup-close").addEventListener("click",(()=>{window.location.href="https://www.twenty-five.com.au/thanks-for-booking-a-call"}))}}function isCalendlyEvent(e){return e.data.event&&0==e.data.event.indexOf("calendly")}window.addEventListener("message",checkCalendlyEventScheduled,!1),calendlyWidgetButton.addEventListener("click",(e=>(e.preventDefault(),e.stopPropagation(),openCalendlyWidget(),!1)));
